import React from 'react'
import kimetsu from '../Images/kimetsu.png'

export default function Header() {
  return (
    <div className="h-full w-full">
        <img src={kimetsu} alt="absolute kimetsu no yaiba" />  
        <div className="absolute z-10 top-0 h-[986px] w-full opacity-100 bg-gradient-to-r from-black via-transparent to-black"></div>
    </div>
  )
}
